CREATE DEFINER=`root`@`localhost` FUNCTION `fn_promedio_trimestral`(p_date datetime, p_id_centro int) RETURNS decimal(11,4)
    READS SQL DATA
BEGIN
	declare promedio_trimestral decimal (11,4);
	set promedio_trimestral = 
	(select avg(monto)
    from transacciones 
    where fecha between DATE_SUB(p_date, interval 90 day) and p_date
    and id_centro = p_id_centro); 

